import React, { useState,  useEffect} from "react";
import axios from "axios";
import "../styles/Carte.css";

const Carte = () => {
   const [profil, setProfil] = useState([]);

   useEffect(() => {
    axios
      .get(`http://localhost:5006/animaux`)
      .then((result) => {
        setProfil(result.data);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

    return (
      <div className='carte'>
      {profil.map((val) => {
        return ( 
            <div className="descri" key={val.id}>
              <img src={`http://localhost:5006/assets/${val.image}`}alt="tete"/>
              <div className="name">{val.name}</div>
              <div className="gabarit">{val.gabarit}{val.type}</div>
              <div className="age">{val.age}</div>
              </div>
          );
        })}
      </div>
)}

export default Carte;
